import React, { useState } from 'react'

export const Form = () => {
  const [name,setName]= useState('Sudipta');
  
  return (
    <div style={{textAlign:'center',background:'purple',height:'100vh',width:'100vw'}}>
      <form onSubmit={(e)=>{setName(name); e.preventDefault()}}>
        <h1>Hello {name}</h1>
        <input onChange={(event)=>{setName(event.target.value)
          value={name}}} />
        <button type='submit'>Click me</button>
        </form>
    </div>
  )
}
